import React from 'react';
import './Navbar.css';

class Navbar extends React.Component {
  constructor(props) {
    super(props);
    this.state = {

    };
  }

  render() {
    return (
      <div class="NavBar">
      <header class="home-page">
    		<div class="container">
    			<div id="branding">
    				<h1><span class="highlight">HELLO</span>ZOE</h1>
    			</div>
    			<nav>
    				<ul>
    					<li class="current"><a href="index.html">Home</a></li>
    					<li><a href="about.html">About</a></li>
    					<li><a href="work.html">Work</a></li>
    				</ul>
    			</nav>
    		</div>
    		<div class="container welcome">
    			<h1>Zoe Kim</h1>
    			<p>(n.) a 75 year old woman in a 23 year old body</p>
    			<a class="more_button" href="about.html">Know More</a>
    		</div>
    	</header>
      </div>
    );
  }
}


export default Navbar;
